-- Advance sql project -- spotify dataset

CREATE TABLE spotify (
    artist VARCHAR(255),
    track VARCHAR(255),
    album VARCHAR(255),
    album_type VARCHAR(50),
    danceability FLOAT,
    energy FLOAT,
    loudness FLOAT,
    speechiness FLOAT,
    acousticness FLOAT,
    instrumentalness FLOAT,
    liveness FLOAT,
    valence FLOAT,
    tempo FLOAT,
    duration_min FLOAT,
    title VARCHAR(255),
    channel VARCHAR(255),
    views FLOAT,
    likes BIGINT,
    comments BIGINT,
    licensed BOOLEAN,
    official_video BOOLEAN,
    stream BIGINT,
    energy_liveness FLOAT,
    most_played_on VARCHAR(50)
);


SELECT * FROM spotify_database.spotify;

SELECT count(*) FROM spotify;

SELECT count(distinct artist) FROM spotify;

SELECT count(distinct album) FROM spotify;

SELECT count(distinct album_type) FROM spotify;

SELECT  MAX(danceability) FROM spotify;
SELECT  MIN(danceability) FROM spotify;

-- Q1. Retrieve the names of all tracks that have more than 1 billion streams.

SELECT stream
FROM spotify 
WHERE stream>10000000;

-- Q2. List all albums along with their respective artists.

SELECT distinct artist,album
FROM spotify;

-- Q3. Get the total number of comments for tracks where licensed = 1.

SELECT SUM(comments) AS TOTAL_COMMENTS
FROM spotify
WHERE licensed=1;

-- Q4. Find all tracks that belong to the album type single.

SELECT track
FROM spotify
WHERE album_type='single';

-- Q5. Count the total number of tracks by each artist.

SELECT artist , COUNT(*) AS TOTAL_SONGS 
FROM spotify
GROUP BY artist;

-- Q6. Calculate the average danceability of tracks in each album.

SELECT album,AVG(danceability) 
FROM spotify
GROUP BY 1
ORDER BY 2 ASC;

-- Q7. Find the top 5 tracks with the highest energy values.

SELECT  track,
MAX(energy) 
FROM spotify
GROUP BY 1
ORDER BY 2 DESC
LIMIT 5;

-- Q8.List all tracks along with their views and likes where official_video = TRUE.

SELECT track,
SUM(views) AS TOTAL_VIEWS,
SUM(likes) AS TOTAL_LIKES
FROM spotify
WHERE official_video ='TRUE'
GROUP BY 1
ORDER BY 2 DESC
LIMIT 5;

-- Q9. For each album, calculate the total views of all associated tracks.

SELECT album,track,
SUM(views)
FROM spotify
GROUP BY 1,2
ORDER BY 3 DESC;

-- Q10. Retrieve the track names that have been streamed on Spotify more than YouTube.

  SELECT * FROM 
 (SELECT 
	 track,
	 most_played_on,
	 COALESCE(SUM(CASE WHEN most_played_on = 'Youtube' THEN stream end),0) STREAMED_ON_YOUTUBE,
	 COALESCE(SUM(CASE WHEN  most_played_on = 'Spotify' THEN stream END),0) STREAMED_ON_SPOTIFY
	 FROM spotify
     GROUP BY 1
     ) AS T1
WHERE STREAMED_ON_SPOTIFY>STREAMED_ON_YOUTUBE
AND STREAMED_ON_YOUTUBE<>0;

-- Q11. Find the top 3 most-viewed tracks for each artist using window functions.

WITH RANKING_ARTIST AS
(SELECT 
	artist,
	track,
	SUM(views),
    DENSE_RANK() OVER (PARTITION BY artist ORDER BY SUM(views)DESC) AS RANK_
	FROM spotify
	GROUP BY 1,2
    ORDER BY 1,2 DESC
 )
 SELECT * FROM RANKING_ARTIST
 WHERE RANK_ <=3;
 
 -- Q12. Write a query to find tracks where the liveness score is above the average.
 
 SELECT track,
		 artist,
		 liveness
		 FROM spotify
		 WHERE liveness > (SELECT AVG(liveness) FROM spotify);
		
 -- Q13.Use a WITH clause to calculate the difference between the highest and lowest energy values for tracks in each album.
 
 WITH CTE 
 AS
 (SELECT album,
		 MAX(energy) AS HIGHEST_ENERGY,
		 MIN(energy) AS LOWEST_ENERGY
		 FROM spotify
		 GROUP BY 1
 )
 SELECT album,
		 HIGHEST_ENERGY-LOWEST_ENERGY AS ENERGY_DIFF
		 FROM CTE;
         
         

         
 
 
 
 





